import React, { useState } from 'react';
import { Link } from 'react-router-dom';

import { Container } from './style';

function goConsult(){
    <Link to='/consult'></Link>
}

const Home: React.FC = () => {
  return (
      <Container>
            <form>
                <h1 className='Titulo'>
                    Bem vindo(a) a Edu. Finc.
                </h1>
                <br />
                <button onClick={ () => <Link to="/consult"></Link>}>
                    Acessar Consultas
                </button>
            </form>
      </Container>
  );
}

export default Home;
